let balanceTransaction = [];
const getBalanceTransaction = (state = balanceTransaction, action) => {
  switch (action.type) {
    case "GET_AMOUNT_TRANSACTION":
      state = action.payLoad.amount;
      return state;
    default:
      return state;
  }
};

export default getBalanceTransaction;
